Elvis Presley - If I Can Dream ( June 1968 )

\&quot;If I Can Dream\&quot; is a song made famous by Elvis Presley, written by Walter Earl Brown and notable for its direct quotations of Martin Luther King, Jr. It was recorded by Presley in June 1968, two months after King\'s assassination. The recording was first released to the public as the finale of Presley\'s \'68 Comeback Special.

Although the song is not technically gospel music, Presley performed the song with the intensity and intonations of southern gospel. It has since appeared on various Presley gospel and/or inspirational compilations.

